import { useState } from "react"

const Content = () => {
    const [picSource, setPicSource] = useState("../images/main_pic.jpg")

    return (

        <div className="col-6 d-flex align-items-center justify-content-center">
            <div className="card">
                <img className='card-img-top' alt='' src={picSource} />
                <div className="card-body">
                    <p className="card-text">This text will be replaced by updated state</p>
                </div>
            </div>
        </div>
    )
}

export default Content
